def find_xor_greater_than_zero(n, m, a):
    x = 1
    c = [1] * (n - 1)
    for i in range(n - 1):
        x = x ^ a[i][0]
    f = 0
    for j in range(m):
        if a[n - 1][j] != x:
            c.append(j + 1)
            f = 1
            break
    if f == 1:
        return ('TAK', c)
    r = 0
    for i in range(n - 1):
        for j in range(1, m):
            if a[i][j] != a[i][0]:
                f = 1
                r = i
                c[i] = j + 1
                break
        if f == 1:
            break
    if f == 1:
        x = 0
        for i in range(n - 1):
            if i == r:
                x = x ^ a[i][c[i] - 1]
            else:
                x = x ^ a[i][0]
        for j in range(m):
            if a[n - 1][j] != x:
                c.append(j + 1)
                break
        return ('TAK', c)
    return ('NIE', None)

